import logo from './logo.svg';
import './App.css';
import Short_link from './components/short_link';
import React,{Component}  from 'react';


class App extends Component {
  getUserURL = (e) => {
    this.setState({
      input_value: e.target.value,
      fetchingStatus: "SHORTEN",
    });
  }
  render(){
    return (
      <div className="App">
        <Short_link getUserURL={this.getUserURL}/>
      </div>
    );
  }


}
export default App;
